import React, {useState} from 'react'
import { Link } from 'react-router-dom'
import { DUMMY_POSTS } from '../data'

const Dashboard = () => {
  const [posts, setPosts] = useState(DUMMY_POSTS)

  return (
    <section className='dashboard'>
      {
        posts.length ? <div className='conytainer dashboard_container'>
          {
            posts.map(post => {
              return <article key={post.id} className='dashboard_post'>
                <div className="dashboard_post-info">
                  <div className="dashboard_post-thumbail">
                    <img src={post.avatar} alt="" />
                  </div>
                  <h5>{posts.title}</h5>
                </div>
                <div className='dashboard_posts-actions'>
                  <Link to={`/posts/${post.id}`} className='btn sm'>View</Link>
                  <Link to={`/posts/${post.id}/edit`} className='btn sm primary'>Edit</Link>
                  <Link to={`/posts/${post.id}/delete`} className='btn sm danger'>View</Link>
                </div>
              </article>
            })
          }
        </div> : <h2 className='center'>You have no posts yet</h2>
      }
    </section>
  )
}

export default Dashboard
